import React from 'react';
import { Text, StyleSheet } from 'react-native'

const Profile = () =>{
    return <Text style={styles.textStyle}>Profile</Text>;
}

const styles = StyleSheet.create({
    textStyle: {
        fontSize: 30
    }
});

export default Profile;
